import React, { useState } from 'react';
import {
  Container,
  Grid,
  Card,
  CardContent,
  Typography,
  Box,
  Button,
  TextField,
  Chip,
  Alert,
  CircularProgress,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Paper,
  Avatar,
  List,
  ListItem,
  ListItemText,
  ListItemAvatar
} from '@mui/material';
import {
  Psychology,
  SentimentSatisfied,
  SentimentNeutral,
  SentimentDissatisfied,
  Assessment
} from '@mui/icons-material';

const EmotionalAnalysis = () => {
  const [analysisText, setAnalysisText] = useState('');
  const [analysisResult, setAnalysisResult] = useState(null);
  const [selectedPlatform, setSelectedPlatform] = useState('general');
  const [isAnalyzing, setIsAnalyzing] = useState(false);

  const platforms = [
    { value: 'general', label: 'General Text', icon: '📝' },
    { value: 'instagram', label: 'Instagram', icon: '📷' },
    { value: 'twitter', label: 'Twitter', icon: '🐦' },
    { value: 'facebook', label: 'Facebook', icon: '👥' }
  ];

  const handleAnalyze = async () => {
    if (!analysisText.trim()) return;

    setIsAnalyzing(true);

    // Simulate AI analysis
    setTimeout(() => {
      const mockResult = {
        label: analysisText.toLowerCase().includes('sad') || analysisText.toLowerCase().includes('stress') ? 'negative' : 'positive',
        confidence: Math.random() * 0.4 + 0.6
      };

      setAnalysisResult(mockResult);
      setIsAnalyzing(false);
    }, 2000);
  };

  const getEmotionIcon = (emotion) => {
    const icons = {
      positive: <SentimentSatisfied sx={{ color: '#4caf50' }} />,
      neutral: <SentimentNeutral sx={{ color: '#ff9800' }} />,
      negative: <SentimentDissatisfied sx={{ color: '#f44336' }} />
    };
    return icons[emotion] || <SentimentNeutral />;
  };

  const mockMoodHistory = [
    { mood: 'positive', timestamp: new Date().toISOString(), confidence: 0.8 },
    { mood: 'neutral', timestamp: new Date(Date.now() - 3600000).toISOString(), confidence: 0.6 },
    { mood: 'negative', timestamp: new Date(Date.now() - 7200000).toISOString(), confidence: 0.7 }
  ];

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <Typography variant="h4" fontWeight="bold" gutterBottom>
        Emotional Analysis Lab 🧠
      </Typography>
      <Typography variant="body1" color="text.secondary" sx={{ mb: 4 }}>
        Analyze your emotions with AI-powered insights and discover patterns in your mental wellness journey
      </Typography>

      <Grid container spacing={3}>
        {/* Text Analysis Section */}
        <Grid item xs={12} md={8}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom sx={{ display: 'flex', alignItems: 'center' }}>
                <Psychology sx={{ mr: 1 }} />
                Real-time Emotion Analysis
              </Typography>

              <FormControl fullWidth sx={{ mb: 2 }}>
                <InputLabel>Platform/Context</InputLabel>
                <Select
                  value={selectedPlatform}
                  label="Platform/Context"
                  onChange={(e) => setSelectedPlatform(e.target.value)}
                >
                  {platforms.map((platform) => (
                    <MenuItem key={platform.value} value={platform.value}>
                      <Box sx={{ display: 'flex', alignItems: 'center' }}>
                        <span style={{ marginRight: 8 }}>{platform.icon}</span>
                        {platform.label}
                      </Box>
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>

              <TextField
                fullWidth
                multiline
                rows={4}
                value={analysisText}
                onChange={(e) => setAnalysisText(e.target.value)}
                placeholder="Share what's on your mind... Try: 'I'm feeling really stressed about my upcoming finals' or 'Had a great day with friends today!'"
                variant="outlined"
                sx={{ mb: 2 }}
              />

              <Button
                variant="contained"
                onClick={handleAnalyze}
                disabled={isAnalyzing || !analysisText.trim()}
                startIcon={isAnalyzing ? <CircularProgress size={20} /> : <Assessment />}
                sx={{ mb: 2 }}
              >
                {isAnalyzing ? 'Analyzing...' : 'Analyze Emotions'}
              </Button>

              {/* Analysis Results */}
              {analysisResult && (
                <Alert 
                  severity="info" 
                  sx={{ 
                    mb: 2,
                    background: 'rgba(102,126,234,0.1)',
                    border: '1px solid rgba(102,126,234,0.3)'
                  }}
                >
                  <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
                    <Box sx={{ display: 'flex', alignItems: 'center' }}>
                      {getEmotionIcon(analysisResult.label)}
                      <Box sx={{ ml: 2 }}>
                        <Typography variant="subtitle2" fontWeight="600">
                          Detected Emotion: {analysisResult.label}
                        </Typography>
                        <Typography variant="caption">
                          Confidence: {(analysisResult.confidence * 100).toFixed(1)}%
                        </Typography>
                      </Box>
                    </Box>
                    <Chip
                      label={analysisResult.label}
                      sx={{
                        backgroundColor: analysisResult.label === 'positive' ? '#4caf50' : '#f44336',
                        color: 'white',
                        fontWeight: 600
                      }}
                    />
                  </Box>
                </Alert>
              )}
            </CardContent>
          </Card>
        </Grid>

        {/* Current Mood Status */}
        <Grid item xs={12} md={4}>
          <Card sx={{ mb: 3 }}>
            <CardContent sx={{ textAlign: 'center' }}>
              <Typography variant="h6" gutterBottom>
                Current Mood Status
              </Typography>
              <Box sx={{ fontSize: '4rem', mb: 2 }}>
                😊
              </Box>
              <Typography variant="h5" fontWeight="600">
                Positive
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Last updated: {new Date().toLocaleTimeString()}
              </Typography>
            </CardContent>
          </Card>

          {/* Mood History */}
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Recent Mood History
              </Typography>
              <List>
                {mockMoodHistory.map((entry, index) => (
                  <ListItem key={index}>
                    <ListItemAvatar>
                      <Avatar sx={{ 
                        bgcolor: entry.mood === 'positive' ? '#4caf50' : 
                                entry.mood === 'neutral' ? '#ff9800' : '#f44336'
                      }}>
                        {entry.mood === 'positive' ? '😊' : 
                         entry.mood === 'neutral' ? '😐' : '😞'}
                      </Avatar>
                    </ListItemAvatar>
                    <ListItemText
                      primary={entry.mood.charAt(0).toUpperCase() + entry.mood.slice(1)}
                      secondary={new Date(entry.timestamp).toLocaleString()}
                    />
                  </ListItem>
                ))}
              </List>
            </CardContent>
          </Card>
        </Grid>

        {/* Demo Success Message */}
        <Grid item xs={12}>
          <Paper sx={{ 
            p: 3, 
            background: 'rgba(76,175,80,0.1)',
            border: '1px solid rgba(76,175,80,0.3)'
          }}>
            <Typography variant="h6" gutterBottom sx={{ color: '#4caf50' }}>
              🚀 Emotional Analysis Demo Ready!
            </Typography>
            <Typography variant="body1">
              Try entering different emotional phrases in the text area above to see the AI analysis in action. 
              Perfect for demonstrating real-time sentiment detection during your hackathon presentation!
            </Typography>
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
};

export default EmotionalAnalysis;
